import React from 'react';
import logo from './logo.svg';
import './App.scss';

import ComNavigation from './components/ComNavigation';

function App() {
  return (
    <div className="App container-fluid navbar navbar-dark bg-dark">
      <div className="row text-center justify-content-center w-100">
        <img src={logo} className="App-logo" alt="logo" />
        <p className="text text--color--white">Lorem Ipsum</p>
      </div>
      <ComNavigation />
    </div>
  );
}

export default App;
